import React from "react";

import {
  Box,
  Grid,
  Container,
  Typography,
  Card,
  Link,
  CardMedia,
} from "@mui/material";

import Tab from "@mui/material/Tab";
import TabContext from "@mui/lab/TabContext";
import TabList from "@mui/lab/TabList";
import TabPanel from "@mui/lab/TabPanel";

import Gallery from "./Gallery.js";

import IconTypography from "../EmojiTypography/IconTypography.js";

import InstagramIcon from "@mui/icons-material/Instagram";

function Photography() {
  const [value, setValue] = React.useState("1");

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <Container>
      {/* Heading/Introduction */}
      <Box sx={{ py: { xs: 2, sm: 4 } }}>
        <Grid container spacing={2}>
          {/* Image of Me */}
          <Grid item xs={12} sm={6}>
            <Card>
              <CardMedia
                component="img"
                height="220"
                image={require("./img/camera-min.jpg")}
                alt="Camera"
              />
            </Card>
          </Grid>
          {/* Bio */}
          <Grid item xs={12} sm={6}>
            {/* Greeting */}
            <Box sx={{ pl: { xs: 0, sm: 3 } }}>
              <Typography variant="h3" component="h3">
                Photos
              </Typography>
              <Link
                href="https://www.instagram.com/zaho.jpeg/"
                underline="hover"
              >
                <IconTypography
                  variant="p"
                  text="@zaho.jpeg"
                  icon={<InstagramIcon sx={{ color: "#C13584" }} />}
                />{" "}
              </Link>
              {/* Facts */}
              <Box sx={{ py: { xs: 2, sm: 4 } }}>
                <Typography variant="p" component="p">
                  Starting around fall 2020, I began taking photos for fun.
                </Typography>
                <br></br>
                <Typography variant="p" component="p">
                  Here are some of my favorites:
                </Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </Box>
      <Box sx={{ width: "100%", typography: "p" }}>
        <TabContext value={value}>
          <Box sx={{ borderBottom: 1, borderColor: "divider" }}>
            <TabList onChange={handleChange} aria-label="lab API tabs example">
              <Tab label="Item One" value="1" />
              <Tab label="Item Two" value="2" />
              <Tab label="Item Three" value="3" />
            </TabList>
          </Box>
          <TabPanel value="1">
            <Gallery album="nyc" />
          </TabPanel>
          <TabPanel value="2">
            <Gallery album="cali" />
          </TabPanel>
          <TabPanel value="3">Item Three</TabPanel>
        </TabContext>
      </Box>
    </Container>
  );
}

export default Photography;
